INSERT INTO S_SS VALUES ( 7941, 'Association', 'A association (R_REL) captures an association between things in the real world. A association is stated in terms of the formal classs (O_OBJ) that model the real world entities participating in the association. There can be any number of associations between the same two classs and any class can participate in any number of associations with other classs.', 'R', 201, 2, 7942 );
