INSERT INTO S_SS VALUES ( 8596, 'Communication And Access', 'Interactions between classes (O_OBJ) are modeled by communication (CA_COMM) and access (CA_ACC) paths. Communication paths show the asynchronous (event) and synchronous (data access) communication in the system between two classes and class/external entity (S_EE) pairs.  ', 'CA', 401, 2, 8597 );
