INSERT INTO O_ATTR VALUES ( 14031, 14030, 0, 'MaxStringLen', 'The model compiler uses fixed length character arrays to implement strings.  This mark establishes the length of the character arrays containing strings.
INSERT INTO O_ATTR VALUES ( 14032, 14030, 14031, 'MaxRelExtent', 'Sets of instances are collected for various AL operations. Relationships with multiplicity MANY require set container mechanisms at the implementation level to manage the collection of related instances. The maximum number of instances allowed in such collections can be controlled with a mark.
INSERT INTO O_ATTR VALUES ( 14033, 14030, 14032, 'MaxSelectExtent', 'Another operation requiring set manipulation is a selection (SELECT MANY) that may result in a collection of multiple instances.
INSERT INTO O_ATTR VALUES ( 14034, 14030, 14033, 'MaxSelfEvents', 'The model compiler attempts to dynamically calculate reasonable and safe values for queue depths within the event generation and delivery mechanism. However, for optimization purposes the user may wish to override these values.
INSERT INTO O_ATTR VALUES ( 14035, 14030, 14034, 'MaxNonSelfEvents', 'The model compiler attempts to dynamically calculate reasonable and safe values for queue depths within the event generation and delivery mechanism.  However, for optimization purposes the user may wish to override these values.
INSERT INTO O_ATTR VALUES ( 14036, 14030, 14035, 'MaxTimers', 'A mark is provided so the system analyst can direct the model compiler to increase or decrease the timer queue used to manage multiple pending xtUML timers (delayed events). To override the compiler calculated queue depth for pending xtUML timers this mark is provided.
INSERT INTO O_ATTR VALUES ( 14037, 14030, 14036, 'MaxInterleavedBridges', 'Use this mark to expand or reduce the depth of the queue used to interleave ``asynchronous' bridge operations between state actions. The default will be a system divined value that should be relatively safe in most cases.
INSERT INTO O_ATTR VALUES ( 14038, 14030, 14037, 'MaxInterleavedBridgeDataSize', 'Use this mark to define how many bytes of argument data come in across an interleaved bridge operation.', '', 'MaxInterleavedBridgeDataSize', 0, 7, '', '' );
INSERT INTO O_ATTR VALUES ( 14039, 14030, 14038, 'CollectionsFlavor', 'Collection types available are singly-linked lists and doubly-linked lists.
INSERT INTO O_ATTR VALUES ( 14040, 14030, 14039, 'PersistInstanceCacheDepth', 'This mark is used to specify the maximum number of instances and links that can be queued waiting to be flushed to non-volatile storage (NVS). As instances and links become "dirty" they get queued to NVS. When PERSIST::Commit is called these queues are flushed. 
INSERT INTO O_ATTR VALUES ( 14041, 14030, 14040, 'PersistLinkCacheDepth', 'This mark is used to specify the maximum number of instances and links that can be queued waiting to be flushed to non-volatile storage (NVS). As instances and links become "dirty" they get queued to NVS. When PERSIST::Commit is called these queues are flushed. 
INSERT INTO O_ATTR VALUES ( 14042, 14030, 14041, 'UnitsToDynamicallyAllocate', 'By default, the model compiler statically allocates instance data and all mechanistic collection containers. This is great for many deeply embedded applications. However, some applications require the flexibility of dynamically allocated storage. In such an application, the number of instances of elements from the xtUML model file is not predictable. Here, the application needs to be able to allocate more memory when the statically allocated memory runs out. 
INSERT INTO O_ATTR VALUES ( 14043, 14030, 14044, 'InstanceLoading', 'This mark enables an instance loader that parses an input xtUML model file and loads in the SQL-formatted pre-existing instance data.  It is mostly useful for model-based model compiler development.
INSERT INTO O_ATTR VALUES ( 14044, 14030, 14042, 'VFB', '', '', 'VFB', 0, 6, '', '' );
