INSERT INTO O_ATTR VALUES ( 14046, 14030, 14045, 'AllPortsPoly', '', '', 'AllPortsPoly', 0, 6, '', '' );
INSERT INTO O_ATTR VALUES ( 14048, 14047, 0, 'enabled', 'MC-3020 provides for tasking/threading using the capabilities of the target operating system (OS) or real-time operating system (RTOS). An example of an RTOS is the Nucleus PLUS real-time operating system. 
INSERT INTO O_ATTR VALUES ( 14049, 14047, 14048, 'flavor', 'flavor is the type of tasking environment being integrated (such as "POSIX" or "Nucleus"). 
INSERT INTO O_ATTR VALUES ( 14050, 14047, 14049, 'serialize', 'serialization is set to "serialize" to force all action across all tasks to be run sequentially. Note that serializing the action processing reduces data access contention, but can severely reduce the multi-tasking performance of the generated system. 
INSERT INTO O_ATTR VALUES ( 14051, 14047, 14050, 'number_of_threads', 'the number of tasks/threads in the xtUML generated system', '', 'number_of_threads', 0, 7, '', '1' );
