INSERT INTO O_OBJ VALUES ( 7943, 'Association', 201, 'R_REL', 'An Association captures an association that exists between things in the real world. An Association is stated in terms of the formal Classs that participates in the association.', 7941 );
INSERT INTO O_OBJ VALUES ( 7954, 'Class As Associated One Side', 209, 'R_AONE', 'In an linked association, this is one of the two classes in the association.   This class is the one at the other end of the association from R_AOTH.', 7941 );
INSERT INTO O_OBJ VALUES ( 7979, 'Class As Associated Other Side', 210, 'R_AOTH', 'In an linked association, this is one of the two classes in the association.  This class is the one at the other end of the association from R_AONE.', 7941 );
INSERT INTO O_OBJ VALUES ( 7994, 'Class As Derived One Side', 216, 'R_CONE', 'In a compositional association, this is one of the two classes in the association.   This class is the one at the other end of the association from R_COTH.', 7941 );
INSERT INTO O_OBJ VALUES ( 8015, 'Class As Derived Other Side', 217, 'R_COTH', 'In a compositional association, this is one of the two classes in the association.   This class is the one at the other end of the association from R_CONE.', 7941 );
INSERT INTO O_OBJ VALUES ( 8030, 'Class As Link', 211, 'R_ASSR', 'The Associator is the class that formalizes the linked association between two classes.', 7941 );
INSERT INTO O_OBJ VALUES ( 8049, 'Class As Simple Formalizer', 207, 'R_FORM', 'A Class As Simple Formalizer is the referring class in a simple association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8066, 'Class As Simple Participant', 206, 'R_PART', 'A Class As Simple Participant is the referred to class in a simple association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8081, 'Class As Subtype', 214, 'R_SUB', 'This class represents a class playing a subtype role in a supertype/subtype association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8095, 'Class As Supertype', 213, 'R_SUPER', 'This class represents a class playing a supertype role in a supertype/subtype association.', 7941 );
INSERT INTO O_OBJ VALUES ( 7963, 'Class In Association', 202, 'R_OIR', 'A Class In Association captures the role which a class plays in participating in an association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8007, 'Derived Association', 215, 'R_COMP', 'A compositional association (R_COMP) is an association between two classes R_CONE, on one side of the association, and R_COTH, on the other.  A compositional association is one  that is formalized by a query along other associations in a loop (R_COMP.Rel_Chn).', 7941 );
INSERT INTO O_OBJ VALUES ( 7971, 'Linked Association', 208, 'R_ASSOC', 'A linked association (R_ASSOC) is an association between two classes (R_AONE and R_AOTH)  which is formalized in an associative class (R_ASSR).  The class that holds the referential attributes for  the association is known as the referring class in the association (R_RGO) and the class that participates in the association and carries the identifying attributes used to formalize the association is the referred to class  (R_RTO).  Linked associations require formalization of the association in a class called the associator (R_ASSR).', 7941 );
INSERT INTO O_OBJ VALUES ( 7955, 'Referred To Class in Assoc', 203, 'R_RTO', 'A Referred To Class In Association is a class which contains identifying attributes which are referred to across the association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8031, 'Referring Class In Assoc', 204, 'R_RGO', 'A referring Class In Association is a class which contains referential attributes which refer to identifying attributes across the association.', 7941 );
INSERT INTO O_OBJ VALUES ( 8059, 'Simple Association', 205, 'R_SIMP', 'A simple association (R_SIMP) is an association between two classs which are formalized with referential attributes in one of the classes.  The class that holds the referential attributes for  the association is know as the referring class in the association (R_RGO) and is the formalizer of the association (R_FORM).  The class that participates in the association and carries the identifying attributes used to formalize the association is the referred to class  (R_RTO) and is a participant in the association (R_PART).', 7941 );
INSERT INTO O_OBJ VALUES ( 8088, 'Subtype Supertype Association', 212, 'R_SUBSUP', 'A supertype/subtype association (R_SUBSUP) is an  between two classes, a supertype (R_SUPER) and a subtype (R_SUB).   The class that holds the referential attributes for  the association is know as the referring class in the association (R_RGO) and the class that participates in the association and carries the identifying attributes used to formalize the association is the referred to class  (R_RTO).  Supertype/Subtype associations are always formalized in the subtype (R_SUB).', 7941 );
