INSERT INTO O_OBJ VALUES ( 8195, 'Body in Element', 644, 'ACT_BIE', 'Convenience class to allow a Body instance to quickly locate its container.
INSERT INTO O_OBJ VALUES ( 8155, 'Body', 601, 'ACT_ACT', 'This class represents the action, whether it be a state action, operation or function body etc.
INSERT INTO O_OBJ VALUES ( 8224, 'Break', 629, 'ACT_BRK', 'This class generates a break statement within a block.', 8151 );
