INSERT INTO O_OBJ VALUES ( 8598, 'Access Path', 408, 'CA_ACC', 'An access path (CA_ACC) represents modeled data access path (on the Synchronous Communication Diagram) between two of the following elements: classes (O_OBJ) and External Entities (S_EEM).  The access path is created by the tool in fully-derived mode, or by the user in partially-derived mode.', 8596 );
INSERT INTO O_OBJ VALUES ( 8615, 'Communication Path', 401, 'CA_COMM', 'A communication path (CA_COMM) represents modeled event communication path (on the Communication Diagram) between two of the following elements: State Machines (SM_SM) and External Entities (S_EEM).  The communication path is created by the tool in fully-derived mode, or by the user in partially-derived mode.', 8596 );
INSERT INTO O_OBJ VALUES ( 8622, 'EE to SM Comm Path', 402, 'CA_EESMC', 'An EE to SM communication path represents a path on the Communication Diagram that originates at an External Entity and terminates at a State Machine.  ', 8596 );
