INSERT INTO O_OBJ VALUES ( 8716, 'SM to OBJ Access Path', 409, 'CA_SMOA', 'An SM to OBJ access path represents a path on the Communication Diagram that originates at a State Machine  and terminates at a class.  ', 8596 );
