INSERT INTO O_OBJ VALUES ( 10305, 'Bridge Parameter', 13, 'S_BPARM', 'A parameter to a bridge (S_BRG) is called a bridge parameter.  Bridge parameters are either passed in by value, or by reference.  Bridge parameters can be accessed by using the param keyword from within a bridge action specification.', 10303 );
INSERT INTO O_OBJ VALUES ( 2133, 'Bridge', 12, 'S_BRG', 'A bridge (S_BRG) is a method associated with an external entity (S_EE).  Bridges can be synchronously called from action specifications.  Each bridge as a return type and zero or more parameters (S_BPARM).', 10303 );
INSERT INTO O_OBJ VALUES ( 822, 'Core Data Type', 10, 'S_CDT', 'Core Data Types are those data types which are fundamental, or core, to all data types.  The core data types are built-in to the tool and cannot be changed.', 10303 );
INSERT INTO O_OBJ VALUES ( 3458, 'Data Type Package in Package', 27, 'S_DPIP', 'Data Type Package in Package represents Data Type Packages nested within other Data Type Packages.', 10303 );
INSERT INTO O_OBJ VALUES ( 226, 'Data Type Package', 25, 'S_DPK', 'Data Type Package represents a package of data types.', 10303 );
INSERT INTO O_OBJ VALUES ( 2896, 'Data Type in Package', 26, 'S_DIP', ' Data Type in Package represents the data types contained within a particular package.', 10303 );
INSERT INTO O_OBJ VALUES ( 250, 'Data Type', 9, 'S_DT', 'An analyst can assign a data type to the various data items in the models, i.e., class attribute, state machine event data item, operation and bridge parameters and return values.  This data type does not capture the representation of the data items, but rather, the characteristics of the data items including:  1) Value Definition, i.e., whole numbers, 2) Value Range, i.e., values between 0 and 10, 3) Operations, i.e., +, -, *, /', 10303 );
INSERT INTO O_OBJ VALUES ( 10373, 'Datatype In Suppression', 35, 'S_DIS', '', 10303 );
INSERT INTO O_OBJ VALUES ( 9022, 'Dimensions', 36, 'S_DIM', '', 10303 );
INSERT INTO O_OBJ VALUES ( 223, 'Domain', 1, 'S_DOM', 'A typical software system generally consists of distinct and independent subject matters. A Shlaer-Mellor analysis partition is based within each of these subject matters and  each subject matter is called a domain (S_DOM). A domain is inhabited by its  own conceptual entities (called classes). A domain may be partitioned into subsystems depending upon its complexity. Each domain is given a mission statement which provides a charter for the construction of the OOA models.', 10303 );
INSERT INTO O_OBJ VALUES ( 3627, 'EE Package in Package', 24, 'S_EEPIP', 'EE Package in Package represents External Entity Packages nested within other External Entity Packages.', 10303 );
INSERT INTO O_OBJ VALUES ( 6752, 'Enumeration Data Type', 14, 'S_EDT', 'An enumeration is a data type represented by a set of constants called enumerators.  For example, an enumeration called Colors might have three enumerators Red, Blue, and Green.', 10303 );
INSERT INTO O_OBJ VALUES ( 10474, 'Enumerator', 15, 'S_ENUM', 'Enumerators are constants that have meaning to the analyst.  An enumeration data type (S_EDT) defines zero or more enumerators.  For example, Red, Blue, and Green are enumerators of the enumeration Color.', 10303 );
INSERT INTO O_OBJ VALUES ( 8689, 'External Entity Data Item', 5, 'S_EEDI', 'An external entity data item is essentially an attribute of an external entity that can be accessed by a class (O_OBJ).  These synchronous Interactions between classes and external entities are shown on the Synchronous Communication Diagrams.  Support for external entity data items is currently absent from the tool.', 10303 );
INSERT INTO O_OBJ VALUES ( 10499, 'External Entity Event Data Item', 7, 'S_EEEDI', 'Each external entity (S_EE) may have zero or more event data items that can be used as supplemental data for external entity events.  The event data items are kept in a pool so that they can be used by one or more external entity events.  When an instance of event data item is used in an event, an instance of S_EEEDT is created to represent the event as data in an event.', 10303 );
INSERT INTO O_OBJ VALUES ( 10513, 'External Entity Event Data', 8, 'S_EEEDT', 'When an instance of event data item (S_EEEDI) is used in an event (S_EEEVT), an instance of S_EEEDT is created to represent the event as data in an event.  The supplemental data for an external entity event are instances of this class.', 10303 );
INSERT INTO O_OBJ VALUES ( 8706, 'External Entity Event', 6, 'S_EEEVT', 'An external entity event (S_EEEVT) represents asynchronous communication between a class (O_OBJ) and an external entity (S_EE).  The communication is shown on the Communication Diagram.  Each external entity event is given a unique label and can have zero or more event data (S_EEEDT).', 10303 );
INSERT INTO O_OBJ VALUES ( 244, 'External Entity Package', 22, 'S_EEPK', 'External Entity Package represents a package of external entities.', 10303 );
INSERT INTO O_OBJ VALUES ( 8628, 'External Entity in Model', 4, 'S_EEM', 'The external entity in model (S_EEM) represents the presence of an external entity (S_EE)  in a model such as the Communication Diagram or Synchronous Communication Diagram. The same external entity can be represented by more than one external entity in model in the same model to enhance model layout.', 10303 );
INSERT INTO O_OBJ VALUES ( 1944, 'External Entity in Package', 23, 'S_EEIP', ' External Entity in Package represents the external entities contained within a particular package.', 10303 );
INSERT INTO O_OBJ VALUES ( 1945, 'External Entity', 3, 'S_EE', 'An external entity (S_EE) represents something outside of the domain (S_DOM) being modeled that interacts with classes (O_OBJ) within the domain. The interactions are shown by event communication paths on the Communication Diagrams and data access paths on the Synchronous Communication Diagrams. Each external entity is given a unique name and keyletters within a domain.', 10303 );
INSERT INTO O_OBJ VALUES ( 3554, 'Function Package in Package', 21, 'S_FPIP', 'Function Package in Package represents Function Packages nested within other Function Packages.', 10303 );
INSERT INTO O_OBJ VALUES ( 247, 'Function Package', 19, 'S_FPK', 'Function Package represents a collection of domain functions.', 10303 );
INSERT INTO O_OBJ VALUES ( 1796, 'Function Parameter', 17, 'S_SPARM', 'A parameter to a function (S_SYNC) is called a function parameter (S_SPARM).  Function parameters are either passed in by value, or by reference.  Function parameters can be accessed by using the param keyword from within a function action specification.', 10303 );
INSERT INTO O_OBJ VALUES ( 1639, 'Function in Package', 20, 'S_FIP', 'Function in Package represents the functions contained within a particular package.', 10303 );
INSERT INTO O_OBJ VALUES ( 1640, 'Function', 16, 'S_SYNC', 'A function (S_SYNC) is a method associated with the domain (S_DOM).  It can be thought of as a global function within the domain.  Functions can be synchronously called from action specifications or used to provide a definition for bridge method  in another domain.', 10303 );
