INSERT INTO O_OBJ VALUES ( 3249, 'Subsystem in Domain', 31, 'S_SID', 'Subsytem in Domain represents Subsytem packages at the top, domain, level.  In other words Subsystem packages that are not nested within other Subsystem packages.', 10303 );
INSERT INTO O_OBJ VALUES ( 3256, 'Subsystem in Subsystem', 30, 'S_SIS', 'Subsystem in Subsystem represents Subsystems that are nested within other Subsystems.', 10303 );
INSERT INTO O_OBJ VALUES ( 238, 'Subsystem', 2, 'S_SS', 'A subsystem (S_SS) is based on the partitioning of an entire domain (S_DOM). The number of subsystems in a domain is dependent upon the domain subject matter and complexity. A subsystem is composed of classes which tend to cluster, i.e., classes which have many  associations with one another but few associations with classes in different clusters. Inter-subsystem associations, asynchronous communications, and synchronous accesses are captured in the Subsystem Relationship Model, Subsystem Communication Model and Subsystem Access Model, respectively.', 10303 );
INSERT INTO O_OBJ VALUES ( 217, 'System Model', 18, 'S_SYS', 'A system is described by one or more models, each drawn from different subject matters. Each subject matter model is called a domain.
INSERT INTO O_OBJ VALUES ( 6769, 'User Data Type', 11, 'S_UDT', 'User Data Types are those data types which have been created by the analyst and derived from the core data types.  ', 10303 );
