INSERT INTO O_OBJ VALUES ( 12260, 'Chain Link', 627, 'ACT_LNK', 'This class represents a link in an association chain. In the string "self->O_OND[R5]->D_D[R7]", there are two chain links, one from the current instance to an instance (or set) of the class with keyletters "D_OND" found by traversing association "R5" and from there to an instance or set of the class with keyletters "D_D", crossing "R7". Each link is captured as an instance of this meta-model class. The target class is captured for each link, as is the association used for the traversal. The order of traversal is significant and is also captured.', 12258 );
INSERT INTO O_OBJ VALUES ( 8492, 'Select From Instances Where', 611, 'ACT_FIW', 'This class represents a statement that selects a set of  instances from a class extent with the support of a where clause.  The where clause consists of a boolean expression containing the special instance handle 'selected'. If the expression evaluates to true, the instance represented by 'selected ' is added to the result set of the statement.
INSERT INTO O_OBJ VALUES ( 8490, 'Select From Instances', 612, 'ACT_FIO', 'This class represents a statement that selects a set of  instances from a class extent.', 12258 );
INSERT INTO O_OBJ VALUES ( 12328, 'Select Related By', 623, 'ACT_SR', 'This class represents a statement that selects a set of instances related across one or more associations.', 12258 );
INSERT INTO O_OBJ VALUES ( 12334, 'Select Related Where', 604, 'ACT_SRW', 'This class represents a statement that selects a set of instances related across one or more associations with the support of a where clause.  The where clause consists of a boolean expression containing the special instance handle 'selected'. If the expression evaluates to true, the instance represented by 'selected ' is added to the result set of the statement.
INSERT INTO O_OBJ VALUES ( 8488, 'Select', 605, 'ACT_SEL', 'This class represents a statement that selects a set of  instances.', 12258 );
