INSERT INTO O_OBJ VALUES ( 7214, 'Action Home', 515, 'SM_AH', 'An action (SM_ACT) resides in an action home, either a Moore action home (SM_MOAH) or a Mealy action home (SM_MEAH).', 12410 );
INSERT INTO O_OBJ VALUES ( 7029, 'Action', 516, 'SM_ACT', 'An action defines the action language that gets executed upon arrival into the state (SM_STATE) that is related to the action.  An action may have both action language (SM_ACT.Action_Semantics)  and a description (SM_ACT.Descrip).', 12410 );
INSERT INTO O_OBJ VALUES ( 12423, 'Cant Happen', 507, 'SM_CH', 'A cant happen is an entry in the state event matrix (SEM) specifying that the event (SM_EVT) should never happen under normal circumstances when received in the state SM_STATE.  When the analyst asserts that the event cant happen in the state he is saying that the event is not expected and an error should be flagged.  ', 12410 );
INSERT INTO O_OBJ VALUES ( 2573, 'Class State Machine', 521, 'SM_ASM', 'An assigner state machine is a state machine for a class.  This is in contrast to an instance state machine (SM_ISM) which is a state machine for an instance.', 12410 );
INSERT INTO O_OBJ VALUES ( 12451, 'Creation Transition', 510, 'SM_CRTXN', 'A creation transition is a transition into a state from no other state.  ', 12410 );
INSERT INTO O_OBJ VALUES ( 12469, 'Event Ignored', 506, 'SM_EIGN', 'An event ignored is an entry in the state event matrix (SEM) specifying that the event (SM_EVT) is ignored when received in the state SM_STATE.  When the analyst asserts that the event is ignored he is saying that the event is expected, but the state machine should not transition on the event, but ignore it.  ', 12410 );
INSERT INTO O_OBJ VALUES ( 12441, 'Event Supplemental Data', 518, 'SM_SUPDT', 'Each event (SM_EVT) may carry supplemental event data defined by state machine event data items (SM_EVTDI).  The supplemental data items for the event are defined by instances of supplemental data items (SM_SDI).
INSERT INTO O_OBJ VALUES ( 2584, 'Instance State Machine', 520, 'SM_ISM', 'An instance state machine is a state machine for an instance of a class.  Each instance of a class can be thought of as executing its own private version of the state machine.  This is in contrast to an assigner state machine (SM_ASM) which is a state machine for the entire class.', 12410 );
INSERT INTO O_OBJ VALUES ( 12459, 'Local Event', 527, 'SM_LEVT', 'A local event is one that is defined in the state machine.  Contrast this to a non-local event which is defined in a different state machine (that of the super-type) than the one in which it is used.', 12410 );
INSERT INTO O_OBJ VALUES ( 12504, 'Mealy Action Home', 514, 'SM_MEAH', 'A Mealy action home represents the home for a Mealy action.', 12410 );
INSERT INTO O_OBJ VALUES ( 12511, 'Mealy State Machine', 512, 'SM_MEALY', 'A Mealy state machine is one in which actions (SM_ACT) are assigned to transitions (SM_TXN).  The action is executed during the transition from one state to another.  Support for mealy state machines is currently absent from the tool.', 12410 );
INSERT INTO O_OBJ VALUES ( 7290, 'Moore Action Home', 513, 'SM_MOAH', 'A Moore action home represents the home for a Moore action.', 12410 );
INSERT INTO O_OBJ VALUES ( 12530, 'Moore State Machine', 511, 'SM_MOORE', 'A Moore state machine is one in which actions (SM_ACT) are assigned to states (SM_STATE).  The state action is executed upon entry into the state.', 12410 );
INSERT INTO O_OBJ VALUES ( 12541, 'New State Transition', 505, 'SM_NSTXN', 'A new state transition is an entry in the state event matrix (SEM) that  represents a transition from one state to another upon the receipt of an event while in a particular state.', 12410 );
INSERT INTO O_OBJ VALUES ( 12555, 'No Event Transition', 509, 'SM_NETXN', 'A no event transition is a transition between to states to which no event is currently assigned. ', 12410 );
INSERT INTO O_OBJ VALUES ( 12568, 'Non Local Event', 526, 'SM_NLEVT', 'A non-local event is one that is defined in another state machine.  Non-local events represent entries in SEMs for events that are defined in a super-type but used on transitions in the sub-type.', 12410 );
INSERT INTO O_OBJ VALUES ( 12576, 'Polymorphic Event', 522, 'SM_PEVT', 'A polymorphic event (SM_PEVT) is one that is defined in a super-type state machine  and used in one or more sub-type state machines.  Each polymorphic event has one or more aliases (SM_NLEVT) in one or more sub-types.', 12410 );
INSERT INTO O_OBJ VALUES ( 12493, 'SEM Event', 525, 'SM_SEVT', 'An SEM (State Event Matrix) event is one that appears in the state event matrix.  Contrast this to a polymorphic event which is defined at the supertype-level but does not appear in the SEM for the super-type.  An SEM event can either be a local event (SM_LEVT), in the case of an event that is defined in the state machine for the class, or a non-local event (SM_NLEVT) which is an alias for a polymorphic event (SM_PEVT) defined in the super-type but accessible via the subtype.', 12410 );
INSERT INTO O_OBJ VALUES ( 12605, 'Signal Event', 528, 'SM_SGEVT', '', 12410 );
INSERT INTO O_OBJ VALUES ( 12424, 'State Event Matrix Entry', 504, 'SM_SEME', 'This class represents an entry in the state event matrix (SEM).  A state event matrix entry describes what happens in each state (SM_STATE) for each event (SM_EVT).  The SEM can be thought of as a two-dimensional array where the states of a state machine  are represented by rows and events are represented by columns.  An entry consists of one of the following: transition to another state, event ignored, event cant happen.', 12410 );
INSERT INTO O_OBJ VALUES ( 10430, 'State Machine Event Data Item', 517, 'SM_EVTDI', 'Each state machine (SM_SM) has a pool of event data items that can be used as supplemental data (SM_SUPDT) for the events (SM_EVT) of the state machine.  When an event data item is used as supplemental data for an event an instance of SM_SDI is created.', 12410 );
INSERT INTO O_OBJ VALUES ( 8562, 'State Machine Event', 503, 'SM_EVT', 'Represents an event for this state machine.  Events can be either State Event Matrix events (SM_SEVT) or polymorphic events (SM_PEVT).', 12410 );
INSERT INTO O_OBJ VALUES ( 7296, 'State Machine State', 502, 'SM_STATE', 'Represents a state in the state machine.', 12410 );
INSERT INTO O_OBJ VALUES ( 2575, 'State Machine', 501, 'SM_SM', 'A State Machine represents the lifecycle of a class in terms of states, transitions, events, and actions.', 12410 );
INSERT INTO O_OBJ VALUES ( 12682, 'Supplemental Data Items', 519, 'SM_SDI', 'It used to help organize event parameters (SM_EVTDI) into common sets to enforce
INSERT INTO O_OBJ VALUES ( 7220, 'Transition Action Home', 529, 'SM_TAH', '', 12410 );
INSERT INTO O_OBJ VALUES ( 11061, 'Transition', 508, 'SM_TXN', 'A transition represents a change in state of an instance.  It is represented by a line between to states (SM_NETXN and SM_NSTXN), or a line into a single state (SM_CRTXN).  Transitions are labeled with a single event (SM_EVT).', 12410 );
INSERT INTO O_OBJ VALUES ( 12724, 'Attribute Reference in Class', 110, 'O_REF', 'The class represents an association number (R#) which follows a referential attribute.', 12722 );
INSERT INTO O_OBJ VALUES ( 193, 'Attribute', 103, 'O_ATTR', 'An attribute is an abstraction of a single characteristic possessed by a class.  Usually classes contain a set of attributes to completely capture all pertinent information.  Each attribute is given a unique name within a class.', 12722 );
INSERT INTO O_OBJ VALUES ( 7057, 'Base Attribute', 106, 'O_BATTR', 'A Base attribute is a non-referential attribute.  Base attributes are either derived base attributes (O_DBATTR) or non-derived base attributes (O_NBATTR).', 12722 );
INSERT INTO O_OBJ VALUES ( 631, 'Class Identifier Attribute', 105, 'O_OIDA', 'An attribute that is part of a class identifier is a class identifier attribute.', 12722 );
INSERT INTO O_OBJ VALUES ( 8130, 'Class Identifier', 104, 'O_ID', 'A set of one or more Attributes which uniquely distinguishes each instance of a class is a class identifier.  A class may have several identifiers.', 12722 );
INSERT INTO O_OBJ VALUES ( 7059, 'Derived Base Attribute', 107, 'O_DBATTR', 'A Derived Attribute is the result of an algorithm used to derive the value. A derived based attribute is said to be mathematically-dependent since is value is derived from other data in the model.  The action for the derived base attribute is used to set the value of the attribute by using the self keyword.', 12722 );
INSERT INTO O_OBJ VALUES ( 8112, 'Imported Class', 102, 'O_IOBJ', 'Classes can have interactions with classes in other subsystems.  In order to capture these spanning interactions, Classes can be imported into another subsystem.  Spanning interactions can be associations, event communications, or data accesses and are captured in class diagram, communication diagram, and synchronous communication diagram, respectively.  Spanning interactions provide the data for derivation of the subsystem association model, subsystem communication model, and subsystem access model.', 12722 );
INSERT INTO O_OBJ VALUES ( 190, 'Model Class', 101, 'O_OBJ', 'A model class represents an abstraction of a real world thing.  All instances of a class have the same characteristics and conform to the same set of rules.  The characteristics of a class are captured as attributes.  Each class within a domain are assigned a unique name, number, and keyletter.', 12722 );
INSERT INTO O_OBJ VALUES ( 12828, 'New Base Attribute', 108, 'O_NBATTR', 'A New Base Attribute is a non-derived base attribute.', 12722 );
INSERT INTO O_OBJ VALUES ( 10408, 'Operation Parameter', 113, 'O_TPARM', 'Each operation (O_TFR) can have one or more parameters (O_TPARM).  A parameter to an operation is called an operation parameter.  Operation parameters are either passed in by value, or by reference.  Operation parameters can be accessed by using the param keyword from within an operation action specification.', 12722 );
INSERT INTO O_OBJ VALUES ( 7047, 'Operation', 112, 'O_TFR', 'A Operation is a method associated with a class.  Operations can be synchronously called from Action Specifications.  Two types of operations exist.  Class-based operations affect the class as a whole.  Instance-based operations affect only an instance.', 12722 );
INSERT INTO O_OBJ VALUES ( 12871, 'Referential Attribute Visited Recorder', 114, 'O_RAVR', 'A non-persistent instance of this class is created per domain.  The sole 
INSERT INTO O_OBJ VALUES ( 891, 'Referential Attribute', 109, 'O_RATTR', 'A referential attribute captures the formalization of an association.  A referential attribute refers to an identifying attribute in the class at the other end of the association which it formalizes.', 12722 );
INSERT INTO O_OBJ VALUES ( 12725, 'Referred To Identifier Attribute', 111, 'O_RTIDA', 'This class serves a linkage between R# (Attribute Reference in Class ) and the referred to class identifier attribute.', 12722 );
