the word 'executed' because execution happens in only one place per stack; the
top stack frame and the innermost block the stack frame has visited. The inner-
most block in stack frame is identified, for a given stack, by the 'isExecuting'
attribute of StackFrame. Only one block can be currently executing for any one
stack frame.

For this frame and block alone, the statement found across R2941 may be said to
be actually executing.

For all other statements found across R2941 the currently executing block is
nested within them (i.e they are all control statements, for, while, if etc).

Note that this does not mean that 'isExecuting' is true for only one block in
stack frame in a stack. All other instances of block in stack frame where
'isExecuting' is true are related to invocations that are waiting for the stack
to unwind.
