    create object instance te_attr of TE_ATTR;
    relate te_attr to o_attr across R2033;
    te_attr.Used = false;
    te_attr.written = false;
    te_attr.written = false;
  end if;
  if ( not te_attr.read )
    attr_attributes_read_count = attr_attributes_read_count + 1;
  end if;
  te_attr.read = true;
  te_attr.Used = true;
  // attributes written
  select one act_ai related by v_avl->V_VAL[R801]->ACT_AI[R689];
